/** *	TestTab navigator * *	@param tabtitle string *	@param loadurl URL ***/ServiceClient.jquery.navigator.TestTab = function(config){	return [{		service : ServiceClient.jquery.view.TabUIAdd,		message : {			tabui : 'tabuipanel',			tabtitle : config.tabtitle || 'Testing'		}	},{		service : ServiceClient.jquery.loader.AjaxLoader,		message : {			loadurl : config.loadurl || 'data.json.php',			workflow : [{				service : ServiceClient.jquery.renderer.TemplateUI,				message : {					template : ServiceClient.jquery.template.Test				}			}]		}	}];}